import React, { Component } from 'react';

class Header extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        const { isLogged, user } = this.props;
        return (
            <div>
                {
                    isLogged &&
                    <div className="info">
                        Welcome, {user.name}
                    </div>
                }
            </div>
        )
    }
}

export default Header;
